CREATE TABLE `Transaction` (
  `Payer A/C no.` bigint default NULL,
  `Transaction ID` bigint,
  `Payee A/C No.` bigint default NULL,
  `Payee Bank` TEXT default NULL,
  `Payee IFSC` bigint default NULL,
  `Type` TEXT default NULL,
  `Amount` bigint default NULL,
  `Date_of_Transaction` varchar(255),
  PRIMARY KEY (`Transaction ID`)
) AUTO_INCREMENT=1;

SELECT * FROM Transaction;